import React from "react";
import {NavLink} from "react-router-dom";

const Navigation = () => {
    return(
        <div>
            <NavLink to = "/">Accueil</NavLink>
            <NavLink to = "/Contact">Contact</NavLink>
            <NavLink to = "/Apropos">Apropos</NavLink>
        </div>
    );
}
export default Navigation;
